import React from 'react';
import styled from 'styled-components';

const MainNavigationItem = styled.div`
  height: 100%;
  position: relative;
`;

const MainNavigationLink = styled.a.attrs({
    href: "#",
    onClick: evt => {
        evt.preventDefault();
    }
})`
  align-items: center;
  color: #999999;
  display: flex;
  flex-flow: row nowrap;
  height: 100%;
  padding: 0 10px;
  text-decoration: none;

  :hover {
    color: #dddddd;
  }
`;

const MainNavigationLinkText = styled.span`
  line-height: 1;
`;

const NavigationItem = ({label}) => {
    return (
        <MainNavigationItem>
            <MainNavigationLink>
                <MainNavigationLinkText>{label}</MainNavigationLinkText>

            </MainNavigationLink>
        </MainNavigationItem>

    );
};

export default NavigationItem;
